import styles from "./Product.module.css";

const Product = ({ image, name, price, tickets, days }) => {
  console.log("hello");

  return (
    <li>
      <img src={image} alt={name} className={styles.image}></img>
      <div className={styles.name}>{name}</div>
      <div>{price}</div>
      <div>{tickets}</div>
      <div>{days}</div>
    </li>
  );
};

export { Product };
